import React, { useState } from 'react';
import { Box, Text, Grommet, Main, Heading, Button } from 'grommet';
import Foooter from './component/Foooter';
import Headerr from './component/Headerr';
import CardsForm from './component/CardsForm';
import TabsForm from './component/TabsForm';
import TabsForm2 from './component/TabsForm2';


function App() {

  const theme = {
    global: {
      colors: {
        brand: '#01A982',
      },
      font: {
        family: 'Roboto',
        size: '18px',
        height: '20px',
      },
    },
  };

  const[hide, setHide]= useState(false);
  const[hidee, setHidee]= useState(false);


  return (
    <Grommet theme={theme}>
      <Headerr />
      <Main pad="small" margin={{ left: 'large', right: 'large'}} >
        <Box>
          <Heading margin={{ left: "small",top: "small", bottom: "none"}}>Hello, Jane!</Heading>
          <Text margin="small">Welcome to the HPE Asset Management Module.</Text>
        </Box>

        <Box direction="row" gap="large" pad="medium">
          <Card  height="small" width="medium" >
                <CardHeader>
                  <Button icon={<Magic />} onClick={() => {}} />
                </CardHeader>
                <CardBody pad={{horizontal: "small"}}>
                <Text weight="bold">Customs Annexure </Text>
                <Text size="xsmall">Part A, B, C, D, E, F, G</Text>
                </CardBody>
                <CardFooter pad="small"> 
                  <Button primary label="TabsForm" size="small" color="brand" />
                </CardFooter>
          </Card>
          <Card  height="small" width="medium" >
                <CardHeader>
                  <Button icon={<Server />} onClick={() => {}} />
                </CardHeader>
                <CardBody pad={{horizontal: "small"}}>
                <Text weight="bold">Asset Tracker</Text>
                <Text size="xsmall">Part A, B, C, D</Text>
                </CardBody>
                <CardFooter pad="small">
                  <Button primary label="TabsForm" size="small" color="brand"/>
                </CardFooter>
          </Card>
        </Box> 
      </Main>

      <Foooter />
    </Grommet>
  );
}

export default App;
